INSERT INTO `tb_content` VALUES ('1','36','Hướng dẫn sinh viên đăng ký đề tài','huong-dan-sinh-vien-dang-ky-de-tai','','<p>Chào mừng bạn đến với hệ thống đăng ký đề tài của khoa Công nghệ Thông tin - ĐH Sư phạm Kỹ thuật TP. Hồ Chí Minh</p>\r\n<p>Đề đăng ký đề tài, bạn cần phải đăng nhập website và thực hiện theo các chỉ dẫn như sau:</p>\r\n','\r\n<p> </p>\r\n<p><img class=\"caption\" src=\"images/dangnhap.png\" border=\"0\" alt=\"Hướng dẫn đăng nhập\" title=\"hướng dẫn đăng nhập\" align=\"left\" /></p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p><strong>Username là mã số sinh viên</strong></p>\r\n<p> </p>\r\n<p>Password: <strong>nếu lần đầu tiên đăng nhập thì password cũng chính là mã số sinh viên (nếu MSSV không được thì password là MSSV nhưng không có số 0 ở đầu- ví dụ 09110090 - pass:09110090 hoặc 9110090)</strong>, nếu bạn đã đổi password thì bạn đăng nhập với password mới.</p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p>Sau khi đăng nhập thành công thì menu sẽ hiện lên chức năng <strong>Đăng ký đề tài</strong> cho Sinh viên</p>\r\n<p>Để đăng ký đề tài bạn click vào menu <strong>Đăng ký đề tài</strong></p>\r\n<p><strong><br /></strong>Nếu lần đầu tiên đăng ký hoặc chưa thay đổi thông tin lần nào thì hệ thống yêu cầu bạn phải xác nhận/ thêm vào các thông tin liên lạc.</p>\r\n<p>Sau khi xác nhận các thông tin thì chọn <a href=\"index.php/dang-ky-de-tai\" target=\"_blank\">Đăng ký đề tài</a></p>\r\n<ul>\r\n<li>Bạn chọn <strong>loại đề tài</strong> cần đăng ký rồi chọn Continue</li>\r\n<li>Nếu bạn chưa đăng ký đề tài nào thì hệ thống hiện ra danh sách các đề tài mà bạn có thể đăng ký, bạn chọn đề tài nào thì nhấp vào link <strong>Đăng ký</strong> đề tài đó</li>\r\n<li>Nếu đề tài bạn mốn đăng ký đã có người đăng ký trước rồi thì bạn chọn vào link <strong>Liên hệ với nhóm trưởng</strong> để xem thông tin liên lạc của nhóm trưởng. Nhóm trưởng sẽ thêm bạn vào đề tài nếu còn chỗ trống.</li>\r\n<li>Nếu bạn đã đăng ký đề tài rồi thì chỉ hiện tên đề tài bạn đã đăng ký. Nếu bạn đăng ký đầu tiên và là trưởng nhóm thì bạn được thêm thành viên khác vào đề tài bằng chức năng <a href=\"http://fit.hcmute.edu.vn:8181/dangkydetai/\">Quản lý nhóm</a>. Nếu bạn không phải trưởng nhóm thì bạn chỉ có thể hủy đăng ký đề tài.</li>\r\n<li>Đề tài có ràng buộc chuyên ngành thì Nhóm trưởng phải thêm các thành viên theo đúng chuyên ngành của đề tài.</li>\r\n</ul>\r\n<p>Mỗi đợt đăng ký đề tài có giới hạn thời gian bắt đầu và thời gian kết thúc, khi hết thời gian đăng ký thì bạn không thể vào chức năng Đăng ký đề tài nữa mà chỉ có thể tìm kiếm các thông tin chung của các đề tài.</p>\r\n<p> </p>\r\n<hr /><hr />\r\n<p> <strong>Chú ý</strong>: Để xem thông tin chi tiết của đề tài bạn click vào link tên của đề tài. Bạn cần chú ý tới số lượng sinh viên tối đa và số lượng đăng ký hiện tại, đề tài còn thêm được thành viên nếu số lượng sinh viên hiện tại nhỏ hơn số lượng sinh viên tối đa cho phép.</p>','1','0','0','8','2012-08-29 02:44:44','201','','2013-01-08 22:33:33','201','201','2013-01-15 17:57:01','2012-08-29 02:44:44','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"0\",\"link_titles\":\"0\",\"show_intro\":\"0\",\"show_category\":\"0\",\"link_category\":\"0\",\"show_parent_category\":\"0\",\"link_parent_category\":\"0\",\"show_author\":\"0\",\"link_author\":\"0\",\"show_create_date\":\"0\",\"show_modify_date\":\"0\",\"show_publish_date\":\"0\",\"show_item_navigation\":\"0\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"0\",\"show_hits\":\"0\",\"show_noauth\":\"0\",\"urls_position\":\"