INSERT INTO `tb_thongbao` VALUES ('2012824132916425110','Thông báo nhận bằng tốt nghiệp ngày 6/1/2012','<p>Sinh vi&ecirc;n nhận bằng tốt nghiệp tại văn ph&ograve;ng khoa c ntt từ 7h tới 8h s&aacute;ng 6/1/2012</p>','204','2013-09-05 12:26:23','0','0'), ('2012824132916425120','Thông báo dời ngày bảo vệ Tiểu luận chuyên ngành CNPM','<p>Ng&agrave;y b&aacute;o c&aacute;o Tiểu luận chuy&ecirc;n ng&agrave;nh C&ocirc;ng nghệ phầm mềm dời sang thứ 5 ng&agrave;y 17/01/2012.</p>','204','2013-02-23 15:40:38','0','1'), ('2012824132916425130','Thông báo bảo vệ Tiểu luận chuyên ngành Công nghệ phần mềm','<p>Sinh vi&ecirc;n nộp tiểu luận chuy&ecirc;n ng&agrave;nh cho gi&aacute;o vi&ecirc;n hướng dẫn hạn ch&oacute;t l&agrave; ng&agrave;y 11/01/2013. Gi&aacute;o vi&ecirc;n hướng dẫn sẽ chuyển b&aacute;o c&aacute;o cho gi&aacute;o vi&ecirc;n phản biện. Sinh vi&ecirc;n tự chủ động li&ecirc;n lạc v&agrave; hẹn gặp với gi&aacute;o vi&ecirc;n phản biện. Ng&agrave;y b&aacute;o c&aacute;o dự kiến l&agrave; 18/01/2013.</p>','204','2013-02-23 15:40:52','0','1'), ('201311641761252','Thông báo ngày bảo vệ Tiểu luận chuyên ngành Hệ thống thông tin','<p>Sinh vi&ecirc;n bảo vệ hệ thống th&ocirc;ng tin ng&agrave;y 21/1/2012</p>','454','2014-09-05 06:08:05','0','1'), ('2013253623155849','Thông báo thời gian đăng ký đề tài tốt nghiệp khóa 09 (học kỳ 2_ 2012-2013)','<p>Theo th&ocirc;ng báo tr&ecirc;n website khoa CNTT, thời gian đăng ký đ&ecirc;̀ tài t&ocirc;́t nghi&ecirc;̣p của khóa 09: từ 7:00 ngày 25/2/2013 đ&ecirc;́n 23:00 ngày 28/2/2013 Sinh vi&ecirc;n xem lại hướng d&acirc;̃n đăng ký tr&ecirc;n website đăng ký đ&ecirc;̀ tài</p>','204','2013-09-05 12:29:36','0','0'), ('20136171521101421','Lịch và hội đồng báo cáo tiểu luận chuyên ngành CNPM ( mới cập nhật )','<p>Lịch v&agrave; hội đồng b&aacute;o c&aacute;o tiểu luận chuy&ecirc;n ng&agrave;nh CNPM ( mới cập nhật )</p>','459','2013-09-05 12:29:33','0','0'), ('2013116417612522','Thông báo thời gian đăng ký tiểu luận chuyên ngành khóa 10','<p>Theo th&ocirc;ng báo tr&ecirc;n <a href=\"http://fit.hcmute.edu.vn/web/guest/home?p_p_id=EXT_UTE_NEWS_INSTANCE_E5Zp&amp;p_p_lifecycle=0&amp;p_p_state=maximized&amp;p_p_mode=view&amp;p_p_col_id=column-2&amp;p_p_col_count=4&amp;_EXT_UTE_NEWS_INSTANCE_E5Zp_struts_action=%2Fext%2Fute_news%2Fview&amp;_EXT_UTE_NEWS_INSTANCE_E5Zp_articleGroupId=1&amp;_EXT_UTE_NEWS_INSTANCE_E5Zp_articleId=13605\">website khoa CNTT</a>, sinh vi&ecirc;n khóa 2010 đăng ký ti&ecirc;̉u lu&acirc;̣n chuy&ecirc;n ngành từ 8 giờ 00 ngày 9/9/2013 đ&ecirc;́n 23 giờ 00 ngày 13/9/2013.</p>\r\n<p>Sinh vi&ecirc;n vào <a href=\"../../../../../../fit.hcmute.edu.vn:8181\">website đăng ký đ&ecirc;̀ tài</a> xem kỹ ph&acirc;̀n <a href=\"../../../../../../huong-dan-sinh-vien-dang-ky-de-tai\">Hướng dẫn sinh vi&ecirc;n đăng k&yacute; đề t&agrave;i </a>&nbsp; đ&ecirc;̉ hi&ecirc;̉u rõ cách thức đăng ký.</p>\r\n<p>Lưu ý:</p>\r\n<ul>\r\n<li>Sinh vi&ecirc;n phải thay đ&ocirc;̉i password mặc định sau khi đăng nh&acirc;̣p.</li>\r\n<li>Ti&ecirc;̉u lu&acirc;̣n chuy&ecirc;n ngành kh&ocirc;ng được đăng ký đ&ecirc;̀ tài khác chuy&ecirc;n ngành n&ecirc;n sinh vi&ecirc;n phải xem lại chuy&ecirc;n ngành của mình tr&ecirc;n website có đúng kh&ocirc;ng.</li>\r\n<li>Sinh vi&ecirc;n phải c&acirc;̣p nh&acirc;̣t lại th&ocirc;ng tin v&ecirc;̀ email, s&ocirc;́ đi&ecirc;̣n thoại, họ t&ecirc;n (n&ecirc;́u chưa đúng) đ&ecirc;̉ thu&acirc;̣n lợi khi li&ecirc;n lạc với GVHD<br /><br /></li>\r\n<li>N&ecirc;́u c&acirc;̀n chỉnh sửa th&ecirc;m th&ocirc;ng tin thì gởi mail v&ecirc;̀ phunghx@fit.hcmute.edu.vn</li>\r\n</ul>','204','2014-09-05 06:06:25','0','1'), ('20131164176125222','Thông báo thay đổi thời gian đăng ký tiểu luận chuyên ngành khóa 10','<p>Thời gian bắt đầu đăng k&yacute; tiểu luận kh&oacute;a 10: từ <span style=\"font-size: medium;\">9 giờ 00</span> ng&agrave;y 9/9/2013 đến <span style=\"font-size: medium;\">16 giờ 00</span> ng&agrave;y 13/9/2013</p>','204','2014-09-05 06:06:29','0','1'), ('20131164176125223','Thông báo lỗi sai password khi đăng nhập','<p>Sinh vi&ecirc;n n&agrave;o qu&ecirc;n password đăng nhập v&agrave;o website đăng k&yacute; đề t&agrave;i th&igrave; gởi email bao gồm MSSV, Họ t&ecirc;n về địa chỉ: phunghx@fit.hcmute.edu.vn để được reset lại.</p>\n<ul>\n<li>Chỉ chấp nhận reset lại cho sinh vi&ecirc;n gởi từ hệ thống email sinh vi&ecirc;n của trường</li>\n<li>Mỗi người chỉ reset lại 1 t&agrave;i khoản</li>\n<li>Nếu quên password email sinh viên thì có thể liên hệ với giảng viên : từ 14 giờ - 16 giờ ngày 9/9/2013 - phòng A1-905</li>\n</ul>','204','2014-02-18 15:11:44','0','1'), ('201402181392711051','Thông báo thời gian đăng ký đề tài tốt nghiệp khóa 2010','<p>Thời gian đăng k&yacute; bắt đầu từ <strong>14 giờ ng&agrave;y 19/2/2014 đến 17 giờ 30 ng&agrave;y 22/2/2014</strong>.</p>\r\n\r\n<p>Lưu &yacute;:</p>\r\n\r\n<ul>\r\n	<li>Sinh vi&ecirc;n qu&ecirc;n password đăng nhập th&igrave; sử dụng chức năng reset tr&ecirc;n website (password sẽ được reset qua email sinh vi&ecirc;n sử dụng li&ecirc;n hệ khi đăng k&yacute; đề t&agrave;i)</li>\r\n	<li>Nếu kh&ocirc;ng nhớ email th&igrave; gởi email y&ecirc;u cầu reset password về email: phunghx@fit.hcmute.edu.vn. Password được reset lại l&agrave; m&atilde; số sinh vi&ecirc;n. (Lưu &yacute;: d&ugrave;ng email sinh vi&ecirc;n để gởi mail)</li>\r\n</ul>\r\n','204','2014-09-04 17:01:40','0','0'), ('201409041409816300','Thông báo đăng ký đề tài tiểu luận chuyên ngành khóa 11','<table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:643px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:321px\">\r\n			<p><strong>TRƯỜNG ĐH SƯ PHẠM KỸ THUẬT</strong></p>\r\n\r\n			<p><strong>TP. HỒ CH&Iacute; MINH</strong></p>\r\n\r\n			<p><strong>KHOA : CNTT</strong></p>\r\n			</td>\r\n			<td style=\"width:321px\">\r\n			<p><strong>CỘNG H&Ograve;A X&Atilde; HỘI CHỦ NGHĨA VIỆT NAM</strong></p>\r\n\r\n			<p><strong>Độc Lập &ndash; Tự Do &ndash; Hạnh Ph&uacute;c</strong></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p><strong>&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong><strong>TH&Ocirc;NG B&Aacute;O</strong></p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (v/v đăng k&yacute; m&ocirc;n Tiểu luận chuy&ecirc;n ng&agrave;nh)</strong></p>\r\n\r\n<p>Khoa CNTT th&ocirc;ng b&aacute;o đến&nbsp;<strong>SV K11</strong>&nbsp;(cả 2 hệ : Kỹ sư v&agrave; hệ Sư Phạm CNTT) về việc đăng k&yacute; học m&ocirc;n Tiểu luận chuy&ecirc;n ng&agrave;nh như sau :</p>\r\n\r\n<ul>\r\n	<li><strong>Đối tượng : sinh vi&ecirc;n CNTT K11 v&agrave; sinh vi&ecirc;n Sư phạm CNTT K11</strong>\r\n\r\n	<ul>\r\n		<li><strong>H&igrave;nh thức :&nbsp;</strong>Đăng k&yacute; tr&ecirc;n website&nbsp;<a href=\"http://dkdt.fit.hcmute.edu.vn\">http://dkdt.fit.hcmute.edu.vn/</a>.</li>\r\n		<li><strong>Thời gian : 13:00 5/9/2014 tới 16:00 12/9/2014</strong></li>\r\n	</ul>\r\n	</li>\r\n	<li>Xem Kết quả : ng&agrave;y&nbsp;<strong>13 -15/9/2014</strong></li>\r\n	<li>Giải quyết điều chỉnh, bổ sung (nếu c&oacute;) :&nbsp;<strong>13 &ndash; 15/9/2014</strong></li>\r\n</ul>\r\n\r\n<p><strong>Lưu &yacute; :</strong></p>\r\n\r\n<ul>\r\n	<li>Danh mục c&aacute;c đề t&agrave;i v&agrave; GVHD được đăng tải tr&ecirc;n website của khoa v&agrave; website http://dkdt.fit.hcmute.edu.vn/, sinh vi&ecirc;n xem v&agrave; đăng k&yacute; trực tiếp tr&ecirc;n mạng (<strong>kh&ocirc;ng phải hệ thống đăng k&yacute; m&ocirc;n học của trường)</strong></li>\r\n	<li>Sinh vi&ecirc;n phải đăng k&yacute; trong thời hạn n&ecirc;u tr&ecirc;n. Qu&aacute; thời hạn tr&ecirc;n khoa sẽ kh&ocirc;ng giải quyết bất cứ trường hợp n&agrave;o.</li>\r\n	<li>Sau khi c&oacute; kết quả đăng k&yacute;, sinh vi&ecirc;n tự li&ecirc;n hệ với GVHD trong thời gian sớm nhất, v&agrave; phải thực hiện nghi&ecirc;m t&uacute;c c&aacute;c y&ecirc;u cầu của GVHD đặt ra.</li>\r\n	<li>Hướng dẫn đăng k&yacute;:&nbsp;<a href=\"http://dkdt.fit.hcmute.edu.vn/huong-dan-dang-ky.html\">http://dkdt.fit.hcmute.edu.vn/huong-dan-dang-ky.html</a></li>\r\n	<li>Sinh vi&ecirc;n kh&oacute;a 2011 sử dụng password l&agrave; m&atilde; số sinh vi&ecirc;n</li>\r\n	<li>Sinh vi&ecirc;n c&aacute;c kh&oacute;a kh&ocirc;ng phải 2011 li&ecirc;n hệ với thầy Đoan để được đăng k&yacute; đề t&agrave;i</li>\r\n	<li>Sinh vi&ecirc;n qu&ecirc;n password c&oacute; thể d&ugrave;ng chức năng&nbsp;&nbsp;<a href=\"http://dkdt.fit.hcmute.edu.vn/quen-mat-khau.html\">Reset password</a>&nbsp;với email l&agrave; email sinh vi&ecirc;n</li>\r\n	<li>C&aacute;c sinh vi&ecirc;n đ&atilde; đăng k&yacute; trước với GVHD th&igrave; kiểm tra lại đề t&agrave;i của m&igrave;nh</li>\r\n	<li>Mọi thắc mắc sinh vi&ecirc;n c&oacute; thể gởi về email: phunghx@fit.hcmute.edu.vn</li>\r\n</ul>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; TP.HCM, ng&agrave;y 3/9/2014</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; P.Trưởng khoa</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>Đinh C&ocirc;ng Đoan</p>\r\n','204','2014-12-23 10:30:37','0','0'), ('201409071410066229','Thông báo đối với sinh viên chưa đăng ký đề tài của cô Phượng','<p>Sinh vi&ecirc;n chưa đăng k&yacute; được đề t&agrave;i của c&ocirc; Phượng (do bị hủy) th&igrave; chuyển sang đề t&agrave;i của thầy c&ocirc; kh&aacute;c.</p>\r\n','204','2014-12-23 10:30:28','0','0'), ('201409091410257985','Thông báo đối với sinh viên làm đề tài thầy Lê','<p>Sinh vi&ecirc;n l&agrave;m đề t&agrave;i thầy L&ecirc; li&ecirc;n hệ với thầy qua email: lenh@fit.hcmute.edu.vn để nhận t&agrave;i liệu</p>\r\n','204','2014-12-23 10:30:23','0','0'), ('201409091410268243','Thông báo sinh viên làm đề tài thầy Tuấn về thời gian liên hê với giáo viên hướng dẫn','<p>Tất cả c&aacute;c sinh vi&ecirc;n đăng k&yacute; l&agrave;m đề t&agrave;i thầy Tuấn gặp thầy Tuấn v&agrave;o l&uacute;c 16.00 ng&agrave;y 13/9/2014 tại ph&ograve;ng giảng vi&ecirc;n A1-303</p>\r\n','204','2014-12-23 10:30:17','0','0'), ('201412231419327272','Thông báo đăng ký chuyên ngành cho sinh viên khóa 2012','<p>Sinh vi&ecirc;n kh&oacute;a 2012 đăng k&yacute; chuy&ecirc;n ng&agrave;nh tại website n&agrave;y từ 8:00 25/12/2014 đến 17:00 ng&agrave;y 31/12/2014. Kết quả sẽ được c&ocirc;ng bố v&agrave;o ng&agrave;y 5/1/2015. Sinh vi&ecirc;n đăng nhập v&agrave;o website n&agrave;y (click v&agrave;o link đăng nhập ở g&oacute;c tr&ecirc;n c&ugrave;ng b&ecirc;n phải của website) với username v&agrave; password l&agrave; M&atilde; số sinh vi&ecirc;n. Nếu qu&ecirc;n password th&igrave; c&oacute; thể d&ugrave;ng chức năng qu&ecirc;n password tr&ecirc;n website với email l&agrave; email sinh vi&ecirc;n. V&iacute; dụ: sinh vi&ecirc;n 11110090 th&igrave; đăng nhập với username, password l&agrave; 11110090 v&agrave; email kh&ocirc;i phục password l&agrave; 11110090@student.hcmute.edu.vn.</p>\r\n\r\n<p>Sau khi đăng nhập, sinh vi&ecirc;n click v&agrave;o chức năng Đăng k&yacute; chuy&ecirc;n ng&agrave;nh ở menu sinh vi&ecirc;n b&ecirc;n tr&aacute;i. Ch&uacute; &yacute;: khi đến thời hạn th&igrave; mới được đăng k&yacute; v&agrave; sinh vi&ecirc;n phải chọn hai nguyện vọng kh&aacute;c nhau.</p>\r\n\r\n<p>Mọi thắc mắc sinh vi&ecirc;n gởi email về phunghx@fit.hcmute.edu.vn.</p>\r\n','204','2015-01-30 15:02:51','0','0'), ('201501301422626565','Thông báo đăng ký khóa luận tốt nghiệp chuyên ngành Mạng máy tính','<p>Khoa CNTT th&ocirc;ng b&aacute;o đến SV K11 (hệ thường v&agrave; hệ sư phạm) về việc đăng k&yacute; LVTN của bộ m&ocirc;n Mạng m&aacute;y t&iacute;nh như sau :<br />\r\n- L&agrave;m kh&oacute;a luận tốt nghiệp (SV hệ ch&iacute;nh quy v&agrave; hệ sư phạm) :<br />\r\no Đối tượng :</p>\r\n\r\n<ul>\r\n	<li>Những sinh vi&ecirc;n K11 hệ kỹ sư c&oacute; tổng số t&iacute;n chỉ t&iacute;ch lũy &gt;= 160 TC v&agrave; điểm trung b&igrave;nh t&iacute;ch lũy &gt;= 6.49 t&iacute;nh tới thời điểm n&agrave;y.</li>\r\n	<li>Những sinh vi&ecirc;n K11 hệ sư phạm muốn l&agrave;m kh&oacute;a luận với bộ m&ocirc;n n&agrave;o th&igrave; phải thỏa m&atilde;n điều kiện : tổng số t&iacute;n chỉ t&iacute;ch lũy &gt;= 171 TC v&agrave; điểm trung b&igrave;nh t&iacute;ch lũy &gt;= 6.5 t&iacute;nh tới thời điểm n&agrave;y..</li>\r\n</ul>\r\n\r\n<p>o H&igrave;nh thức đăng k&yacute; : Đăng k&yacute; theo h&igrave;nh thức đăng k&yacute; tr&ecirc;n mạng, Danh mục c&aacute;c đề t&agrave;i v&agrave; GVHD được đăng tải tr&ecirc;n website của khoa , sinh vi&ecirc;n xem v&agrave; đăng k&yacute; trực tiếp tr&ecirc;n website http://dkdt.fit.hcmute.edu.vn/(<strong>kh&ocirc;ng phải hệ thống đăng k&yacute; m&ocirc;n học của trường) </strong>mọi th&ocirc;ng tin đăng k&yacute; li&ecirc;n hệ trực tiếp Thầy Nguyễn Hữu Trung<br />\r\no Danh mục c&aacute;c đề t&agrave;i, sinh vi&ecirc;n đạt ti&ecirc;u chuẩn v&agrave; c&aacute;c th&ocirc;ng tin li&ecirc;n quan được đăng tr&ecirc;n website của khoa CNTT.<br />\r\no Thời gian đăng k&yacute; : 2-02-2015 tới 7-02-2015<br />\r\no Xem kết quả : 10-02-2015 tới 15-02-2015<br />\r\nLưu &yacute; :<br />\r\n- Chỉ những SV hội đủ ti&ecirc;u chuẩn đ&atilde; n&ecirc;u được đăng k&yacute; l&agrave;m LVTN, khoa kh&ocirc;ng giải quyết bất cứ trường hợp n&agrave;o kh&aacute;c.<br />\r\n- Những sinh vi&ecirc;n sau khi đ&atilde; đăng k&yacute; đề t&agrave;i LVTN th&igrave; tự li&ecirc;n hệ với GVHD trong thời gian sớm nhất</p>\r\n','204','2015-01-30 15:31:17','1','0'), ('201501301422626872','Thông báo đăng ký khóa luận tốt nghiệp và các môn học tốt nghiệp','<p>Khoa CNTT th&ocirc;ng b&aacute;o đến SV K11 (hệ thường v&agrave; hệ sư phạm) về việc đăng k&yacute; LVTN v&agrave; học c&aacute;c m&ocirc;n tốt nghiệp như sau :<br />\r\n- L&agrave;m kh&oacute;a luận tốt nghiệp (SV hệ ch&iacute;nh quy v&agrave; hệ sư phạm) :<br />\r\no Đối tượng :</p>\r\n\r\n<ul>\r\n	<li>Những sinh vi&ecirc;n K11 hệ kỹ sư thuộc bộ m&ocirc;n n&agrave;o căn cứ v&agrave;o ti&ecirc;u chuẩn do bộ m&ocirc;n đ&oacute; đưa ra</li>\r\n	<li>Những sinh vi&ecirc;n K11 hệ sư phạm muốn l&agrave;m kh&oacute;a luận với bộ m&ocirc;n n&agrave;o th&igrave; phải thỏa m&atilde;n điều kiện do bộ m&ocirc;n đ&oacute; đưa ra.</li>\r\n</ul>\r\n\r\n<p>o H&igrave;nh thức đăng k&yacute; : Đăng k&yacute; theo h&igrave;nh thức do bộ m&ocirc;n c&ocirc;ng bố<br />\r\no Danh mục c&aacute;c đề t&agrave;i, sinh vi&ecirc;n đạt ti&ecirc;u chuẩn v&agrave; c&aacute;c th&ocirc;ng tin li&ecirc;n quan : được d&aacute;n theo th&ocirc;ng b&aacute;o n&agrave;y tại khoa v&agrave; được đăng tr&ecirc;n website của khoa CNTT.<br />\r\no Thời gian đăng k&yacute; : theo th&ocirc;ng b&aacute;o, hướng dẫn của bộ m&ocirc;n<br />\r\no Xem kết quả : 10-02-2015 tới 15-02-2015</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Học c&aacute;c m&ocirc;n tốt nghiệp :<br />\r\n- K09+K10+K11 : C&aacute;c m&ocirc;n tốt nghiệp : Chuy&ecirc;n Đề 3 (M&atilde; : 1285190)<br />\r\nv&agrave; Chuy&ecirc;n Đề 4 (M&atilde; : 1279250)<br />\r\no Đối tượng : C&aacute;c SV c&ograve;n lại của K09+K10 v&agrave; c&aacute;c SV đủ ĐK của K11 (hệ ch&iacute;nh quy, kh&ocirc;ng l&agrave;m LVTN, nhưng c&oacute; tổng số t&iacute;n chỉ t&iacute;ch lũy &gt;=147, hệ sư phạm c&oacute; tổng số t&iacute;n chỉ t&iacute;ch lũy &gt;=158 th&igrave; được ph&eacute;p đăng k&yacute; học c&aacute;c m&ocirc;n tốt nghiệp).<br />\r\no H&igrave;nh thức : Đăng k&yacute; tại VPK (C.Hạnh), nhớ ghi đầy đủ th&ocirc;ng tin.<br />\r\no Thời gian : 2-02-2015 tới 7-02-2015<br />\r\nLưu &yacute; :<br />\r\n- Chỉ những SV hội đủ ti&ecirc;u chuẩn đ&atilde; n&ecirc;u được đăng k&yacute; l&agrave;m LVTN, khoa kh&ocirc;ng giải quyết bất cứ trường hợp n&agrave;o kh&aacute;c.<br />\r\n- Những sinh vi&ecirc;n sau khi đ&atilde; đăng k&yacute; đề t&agrave;i LVTN th&igrave; tự li&ecirc;n hệ với GVHD trong thời gian sớm nhất để thực hiện cho đ&uacute;ng tiến độ v&agrave; phải tu&acirc;n thủ những quy định do GVHD phụ tr&aacute;ch đưa ra.<br />\r\n- Qu&aacute; thời hạn tr&ecirc;n khoa sẽ kh&ocirc;ng giải quyết bất cứ trường hợp n&agrave;o.<br />\r\n- Những sinh vi&ecirc;n đăng k&yacute; học m&ocirc;n tốt nghiệp phải ghi đầy đủ th&ocirc;ng tin v&agrave;o phiếu đăng k&yacute;, nếu kh&ocirc;ng sẽ bị gạch t&ecirc;n khỏi danh s&aacute;ch.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n','204','2015-01-30 15:07:52','1','0');
